import React, { Component } from 'react'
const TrainerInfoprovider =React.createContext()
export class TrainerInfo extends Component {
    state={
        id:"srinivas",
        age:40,
        course:"React",
        performance1:"great"
    }
  render() {
    return (
      <TrainerInfoprovider.Provider value={this.state}>
        {this.props.children}
      </TrainerInfoprovider.Provider>
    )
  }
}
export const TrainerConsumer=TrainerInfoprovider.Consumer;
